// Changelog:
// ===============================================================================
// v4.0.6
// - Fixed bugs still present on inventory pages caused by recent eRepublik changes.
// - Changed "Health after day change". It is now displayed on health bar hover.
// ===============================================================================
// v4.0.7
// - Reworked PHP Developer advertisement. Now is in the right position.
// - Option to turn off the PHP Developer advertisement. Click on the eRA box.
// ===============================================================================
// v4.0.8
// - Fixed compatibility issues to third-party localStorage users on Chrome.
// - Removed PHP Developer ads hide option.
// - Fixed Show all buildings button on My land page.
// - Added option to turn off the Country Status box.
// - Fixed super soldier calculator. It will remember the last settings.
// - Fixed rank calculator. It will remember the last settings.
// - Fixed influence calculator. It will remember the last settings.
// - Fixed health prediction. Only houses can affect it.
// ===============================================================================
// v4.0.9
// - Banner place recognition.
// ===============================================================================
// v4.0.10
// - Shout "Show less" button redesign.
// - Added "Collections" section to sidebar mini inventory.
// - Added support for new Q6 food and weapons.
// - Fixed "Influence done" table "NaN" errors on profile page.
// - Partial implementation of new global namespace (Not affecting end-user).
// - Added Kosovo and Albania.
// - Fixed influence catcher in case battlefield pop-up window is disabled.
// ===============================================================================
// v4.0.11.0
// - Added recoverable health to health bar.
// - Fixed data gathering for "Collections" section on sidebar.
// - Fixed influence calculator on profile pages in case of ranks above God of War.
//   and in case of Top Player Lvl.100+ (+10% Damage bonus).
// - Minor style changes on Rank Calculator to match SS Calculator.
// - Added 4th version number.
// - Fixed region links on "Wars" page.
// - Removed "Hide Country Status box" option. Not needed.
// - Added "Daily orders" progress to battlefield.
// - Removed "Fight against NE" from profile calculators. Not used any more.
// - Fixed small bug in Natural Enemy module.
// - Fixed influence data collection.
// - Fixed "undefined" bug in "Influence done" section on profile page in case of
//   new users.
// - Recoded "Hits needed" on battlefield pages. It should work properly now.
// - Removed "Article translate". Google stopped providing free translate API.
// - Recoded "Less shouts" button. Now it works even when switching back and forth
//   from Citizen and Group feeds.
// - Fixed rank column on Influence table on profile page. Due to eRepublik changes
//   rank points are no longer influenced by natural enemy.
// ===============================================================================
// v4.1.0.0
// - Fixed another bug in influence catcher in case when fighting against NE.
// - Made "Hits needed" on battlefield pages react to weapon change.
// - Fixed "Hits needed" bug displaying wrong amount when using bazooka.
// - Added "Max damage" to battlefield. It will display maximum possible damage
//   with current amount of food fights using selected weapon.
// - Lowered time between data refresh for articles section from 60min to 1min.
// - Reimplemented "Natural enemy" checkbox to Influence Calculator on profile
//   page. Natural Enemy doesn't affect rank points but it does affect Influence.
// - Removed 4th version number from sidebar. It is for internal use.
// - Changed style of battle hero influences on Battlefield page to "space" style.
// - Fixed some bugs with "Natural Enemy Icon" caused by changed eRepublik source.
// - Added option to prevent sidebar scrolling.
// - Added "Storage" tab to profile page. It was removed by recent changes.
// - Removed stuff that is not needed anymore due to changes in eRepublik.
// - Changed exchange rate data fetching to a faster and more reliable code.
// - Fixed "Go to offer" link on inventory page.
// - Changed style of Mercenary display on Profile page.
// - Added Mercenary tracker to sidebar, war list and battlefield.
// - Added "Share shout link".
// - Added an option to reset settings and data.
// - Added "Send message" and "Donate" links to employees page.
// - Added ability to store and recall data for in-game messages.
// - Added "Follow eRA" Twitter button.
// ===============================================================================
